const APropos = () => {
    return (
      <div>
        <h2>À propos de moi</h2>
        <p className="px-6; text-justify"> Je suis développeuse d'applications web pour CGI.
          Je suis actuellement en master humanités numériques parcours création et édition numérique.</p>
      </div>
    );
  };
    
  export default APropos;
